const Appointment = require('../../assets/img/icons/apointmentOff.png')
const ShopOn = require('../../assets/img/icons/shop.png')
const Shop = require('../../assets/img/icons/shopOff.png')
const BagOn = require('../../assets/img/icons/bag.png')
const Bag = require('../../assets/img/icons/bagOff.png')
const HomeOn = require('../../assets/img/icons/Home.png')
const Home = require('../../assets/img/icons/HomeOff.png')
const ProfileOn = require('../../assets/img/icons/Profile.png')
const Profile = require('../../assets/img/icons/ProfileOff.png')
const price = require('../../assets/img/icons/price.png')
const priceOff = require('../../assets/img/icons/priceOff.png')

// Profile
const Avatar = require('../../assets/img/picture.png')
const Gift = require('../../assets/img/icons/gift.png')
const Arrow = require('../../assets/img/icons/arrow.png')
const Read = require('../../assets/img/icons//book.png')
const Edit = require('../../assets/img/icons/edit.png')




const getit = require('../../assets/img/icons/shoppingColored.png')
const Search = require('../../assets/img/icons/search.png')
const SearchOn = require('../../assets/img/icons/searchOn.png')
const ShopSuits = require('../../assets/img/icons/shopSuist.png')
const ShopShirt = require('../../assets/img/icons/shopShirt.png')
const Delete = require('../../assets/img/icons/delete.png')
const Minus = require('../../assets/img/icons/minus.png')
