// Items
const item1 = require('../../assets/img/items/2.png')
const Customize = require('../../assets/img/icons/sewing-machine.png')
const CustomizeSuits = require('../../assets/img/icons/customize.png')


module.exports = {
    Icons: {
        Home,
        HomeOn,
        price,
        priceOff,
        Profile,
        ProfileOn,
        ShopOn,
        Shop,
        ShopSuits,
        ShopShirt,
        Appointment,
        AppointmentOn,
        Search,
        SearchOn,
